var GetCurrentEmployee = Class.create();
GetCurrentEmployee.prototype = Object.extendsObject(global.AbstractAjaxProcessor, {
    getCurrentEmployee: function() {
		gs.info("Comenzo getCurrentEmployee");
		gs.info(this.getParameter('sysparm_employeeid'));
        var employeeRecord = new GlideRecord("x_58872_needit_employees");
        employeeRecord.get(this.getParameter('sysparm_employeeid'));
		gs.info(employeeRecord.current_employee);
        return employeeRecord.current_employee;
    },
    type: 'GetCurrentEmployee'
});
